// AlbumResults.js
import React from 'react';

function AlbumResults({ results }) {

    if (results.length === 0) {
        // If there are no results, return null (component won't render)
        return null;
      }
      
  return (
    <div>
      <h2>Album Results</h2>
      <ul>
        {results.map((result) => (
          <li key={result._id}>
            <strong>Album:</strong> {result.albumTitle}, <strong>Artist:</strong> {result.artist}, <strong>Year:</strong>{' '}
            {result.year}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default AlbumResults;
